[{"location":"#DTWDT.jl-1","page":"Home","title":"DTWDT.jl","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"Dynamic Time Warping for evaluating Time shift and Distance between two signals.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"This package is developed in reference to  Dylan Mikesell's DynamicWarping repo in MATLAB and tclements/DynamicWarping-python.","category":"page"},{"location":"#Instalation-1","page":"Home","title":"Instalation","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"pkg> add https://github.com/kura-okubo/DTWDT.jl","category":"page"},{"location":"#Functions-1","page":"Home","title":"Functions","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Examples-1","page":"Home","title":"Examples","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"You can try examples by running scripts in EXAMPLE.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"e.g. >julia DTWDT_run_example.jl","category":"page"},{"location":"#","page":"Home","title":"Home","text":"or","category":"page"},{"location":"#","page":"Home","title":"Home","text":">julia example_stretchedData.jl","category":"page"},{"location":"#Versions-1","page":"Home","title":"Versions","text":"","category":"section"},{"location":"#","page":"Home","title":"Home","text":"v1.0: Full translation of Dylan Mikesell's DynamicWarping repo.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"v1.1: release a function dtwdt for the time shift analysis. see EXAMPLE/example_stretchedData.jl.","category":"page"},{"location":"#","page":"Home","title":"Home","text":"Copyright © Kurama OKubo, 2019","category":"page"},{"location":"Functions/#DTWDT-Functions-1","page":"Functions","title":"DTWDT Functions","text":"","category":"section"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"These are fundamental functions to calculate DTW distance distance array and DTW error between two time series.","category":"page"},{"location":"Functions/#Main-function-1","page":"Functions","title":"Main function","text":"","category":"section"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"dtwdt returns time shift, distance function and DTW error between two signals.","category":"page"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"Example:","category":"page"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"stbarTime, stbar, dist, dtwerror = dtwdt(u0, u1, dt, dtwnorm=\"L2\", maxLag=80, b=1, direction=1)","category":"page"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"dtwdt","category":"page"},{"location":"Functions/#DTWDT.dtwdt","page":"Functions","title":"DTWDT.dtwdt","text":"dtwdt(u0::Array{Float64,1}, u1::Array{Float64,1}, dt::Float64; dtwnorm::String=\"L2\"\n    maxlag::Int64=80, b::Int64=1, direction::Int64=1)\n\nreturns minimum distance time lag and index in dist array, and dtw error between traces.\n\nArguments\n\nu0, u1::Array{Float64,1}: Time series.\ndt::Float64: time step (dt of u0 and u1 should be same)\ndtwnorm::String: norm to calculate distance; effect on the unit of dtw error. (L2 or L1)\nNote: L2 is not squard, thus distance is calculated as (u1[i]-u0[j])^2\nmaxlag::Int64: number of maxLag id to search the distance.\nb::Int64t: b value to controll in distance calculation algorithm (see Mikesell et al. 2015).\ndirection::Int64: length of noise data window, in seconds, to cross-correlate.\n\nOutputs\n\nstbarTime::Array{Float64,1}: series of time shift at t.\nstbar::Array{Int64,1}: series of minimum distance index in distance array.\ndist::Array{Int64,2}: distance array.\ndtwerror::Float64: dtw error (distance) between two time series.\n\n\n\n\n\n","category":"function"},{"location":"Functions/#Sub-functions-1","page":"Functions","title":"Sub functions","text":"","category":"section"},{"location":"Functions/#","page":"Functions","title":"Functions","text":"computeErrorFunction\naccumulateErrorFunction\nbacktrackDistanceFunction\ncomputeDTWerror","category":"page"},{"location":"Functions/#DTWDT.DTWDTfunctions.computeErrorFunction","page":"Functions","title":"DTWDT.DTWDTfunctions.computeErrorFunction","text":"USAGE: err = computeErrorFunction( u1, u0, nSample, lag )\n\nINPUT:\n\nu1      = trace that we want to warp; size = (nsamp,1)\n\nu0      = reference trace to compare with: size = (nsamp,1)\n\nnSample = numer of points to compare in the traces\n\nlag     = maximum lag in sample number to search\n\nnorm    = 'L2' or 'L1' (default is 'L2')\n\nOUTPUT:\n\nerr = the 2D error function; size = (nsamp,2*lag+1)\n\nThe error function is equation 1 in Hale, 2013.\n\nYou could umcomment the L1 norm and comment the L2 norm if you want on Line 29\n\nOriginal by Di Yang  Last modified by Dylan Mikesell (25 Feb. 2015)\n\n\n\n\n\n","category":"function"},{"location":"Functions/#DTWDT.DTWDTfunctions.accumulateErrorFunction","page":"Functions","title":"DTWDT.DTWDTfunctions.accumulateErrorFunction","text":"USAGE: d = accumulationdiwmod( dir, err, nSample, lag, b )\n\nINPUT:\n\ndir = accumulation direction ( dir > 0 = forward in time, dir <= 0 = backward in time)\n\nerr = the 2D error function; size = (nsamp,2*lag+1)\n\nnSample = numer of points to compare in the traces\n\nlag = maximum lag in sample number to search\n\nb = strain limit (integer value >= 1)\n\nOUTPUT:\n\nd = the 2D distance function; size = (nsamp,2*lag+1)\n\nThe function is equation 6 in Hale, 2013.\n\nOriginal by Di Yang Last modified by Dylan Mikesell (25 Feb. 2015)\n\n\n\n\n\n","category":"function"},{"location":"Functions/#DTWDT.DTWDTfunctions.backtrackDistanceFunction","page":"Functions","title":"DTWDT.DTWDTfunctions.backtrackDistanceFunction","text":"USAGE: stbar = backtrackDistanceFunction( dir, d, err, lmin, b )\n\nINPUT:\n\ndir   = side to start minimization ( dir > 0 = front, dir <= 0 =  back)\n\nd     = the 2D distance function; size = (nsamp,2*lag+1)\n\nerr   = the 2D error function; size = (nsamp,2*lag+1)\n\nlmin  = minimum lag to search over\n\nb     = strain limit (integer value >= 1)\n\nOUTPUT:\n\nstbar = vector of integer shifts subject to |u(i)-u(i-1)| <= 1/b\n\nThe function is equation 2 in Hale, 2013.\n\nOriginal by Di Yang Last modified by Dylan Mikesell (19 Dec. 2014)\n\n\n\n\n\n","category":"function"},{"location":"Functions/#DTWDT.DTWDTfunctions.computeDTWerror","page":"Functions","title":"DTWDT.DTWDTfunctions.computeDTWerror","text":"Compute the accumulated error along the warping path for Dynamic  Time Warping.\n\nUSAGE: function error = computeDTWerror( Aerr, u, lag0 )\n\nINPUT:\n\nAerr = error MATRIX (equation 13 in Hale, 2013)\n\nu    = warping function (samples) VECTOR\n\nlag0 = value of maximum lag (samples) SCALAR\n\nWritten by Dylan Mikesell Last modified: 25 February 2015\n\n\n\n\n\n","category":"function"},{"location":"Sampleresults/#Sample-Results-1","page":"Sample results","title":"Sample Results","text":"","category":"section"},{"location":"Sampleresults/#example_stretchedData.jl-1","page":"Sample results","title":"example_stretchedData.jl","text":"","category":"section"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Example case for time shift analysis of stretched time series. (Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"The input data is time shifted by dv/v = -0.01 + Random noise on time shift function s(t).","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Other parameters:","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"dt = 0.05 [s], peak frequency of convolved Ricker wavelet = 1.0 [Hz], duration = 30[s]","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"(Image: ) Blue line shows the pre-described s(t) and  orange dots indicate the estimated time shift.","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"(Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Color contour shows the distance between two signals associated with corresponding time lag τ. Distance array shows the saddle point of cost function, which provides most likely time shift at each time.","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"(Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"This shows a schematic of dynamic time warping. Grey lines shows the corresponding points of time shift using the distance array above.","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"(Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Finally, the estimated dv/v by linear regression of estimated time shift is in agreement with the prescribed value.","category":"page"},{"location":"Sampleresults/#DTWDT_run_example.jl-1","page":"Sample results","title":"DTWDT_run_example.jl","text":"","category":"section"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"DTW Distance Array: (Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Comparison of time shift function s(t): (Image: )","category":"page"},{"location":"Sampleresults/#","page":"Sample results","title":"Sample results","text":"Raw, shifted and warped traces from DTW distance function: (Image: )","category":"page"}]
